.countdown {
  display: grid;
  font-weight: 400;
  grid-template-columns: auto auto auto 32px;
  grid-column-gap: 30px;
  justify-items: center;
  justify-content: center;
}
.countdown .remaining {
  display: flex;
  flex-direction: column-reverse;
  font-size: 0.9em;
  text-align: right;
  padding-bottom: 14px;
  line-height: 14px;
  padding-top: 20px;
}
.countdown .labels {
  font-size: 14pt;
  padding-top: 20px;
}
.countdown .time {
  font-size: 1.8em;
  font-weight: 1000;
  font-family: "Courier New", Courier, monospace;
}
